webpackJsonp([0xbf081fcef84c],{4356:function(n,t){n.exports={data:{markdownRemark:{html:'<h2>Input</h2>\n<p>The HTML <code>&#x3C;input></code> tag is used within a form to declare an input element.\nIt allows the user to enter data.</p>\n<h2>Example</h2>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token doctype">&lt;!DOCTYPE html></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>html</span><span class="token punctuation">></span></span>\n\n   <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>head</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>title</span><span class="token punctuation">></span></span>HTML input Tag<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>title</span><span class="token punctuation">></span></span>\n   <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>head</span><span class="token punctuation">></span></span>\n\t\n   <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>body</span><span class="token punctuation">></span></span>\n      &lt;form action = "/cgi-bin/hello_get.cgi" method = "get">\n         First name: \n            &lt;input type = "text" name = "first_name" value = "" maxlength = "100" />\n            <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span> <span class="token punctuation">/></span></span>\n            \n         Last name: \n            &lt;input type = "text" name = "last_name" value = "" maxlength = "100" />\n         &lt;input type = "submit" value = "Submit" />\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>form</span><span class="token punctuation">></span></span>\n   <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>body</span><span class="token punctuation">></span></span>\n\t\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>html</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>In the above example, there are two input fields which ask the user to enter their first and last names according to the labels specified. The submit <code>&#x3C;button type="submit"></code> is another type of input which is used to take the data entered by the user into the form and send it to some other location specified in the code.</p>\n<h4>More Information:</h4>\n<p><a href="https://www.youtube.com/watch?v=qJ9ZkxmVf5s">Youtube</a></p>',fields:{slug:"/html/attributes/input/"},frontmatter:{title:"Input"}}},pathContext:{slug:"/html/attributes/input/"}}}});
